import React from 'react';
import { Modal } from 'react-materialize';
import Admin from '../Admin';
import TrgiggerButton from './TriggerButton';

function AdminModal() {
    return (
        <>
            <TrgiggerButton />
            <Modal id = 'admin-modal' header = 'Admin login'>
                <Admin />
            </Modal>
        </>
    )
}

export default AdminModal;
